import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import {
    createBrowserRouter,
    RouterProvider,
    // Route,
  } from "react-router-dom";
import FourteenersApp, {
  loader as peakLoader,
} from './components/FourteenersApp/FourteenersApp';
import ErrorPage from "./components/ErrorPage/ErrorPage";
import PeakContainer from './components/PeakContainer/PeakContainer';

  const router = createBrowserRouter([
    {
      path: "/",
      element: <FourteenersApp />,
      // errorElement: <ErrorPage />,
      loader: peakLoader,
    //   action: rootAction,
      children: [
        {
          errorElement: <ErrorPage />,
          children: [
            { index: true, 
              element: <PeakContainer />,
              // loader: peakLoader,
            },
          ]
        }
      ],
    },
  ]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <RouterProvider router={router} />
    </React.StrictMode>
);

// put react.strict back when finished

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
